import styled from "@emotion/styled";

const Container = styled.div<ContainerStyle>`
  display: flex;
  justify-content: start;
  height: 100%;
  width: 1.5rem;
  padding: auto;
  margin: auto;
  color: var(--font-color);
  text-align: center;
  align-items: center;
  background-color: var(--${(props) => props.backgroundColor || "bg-one"});
`;

export { Container };
